export default function Card(props) {

  const handleClick = () => {
    console.log("Card clicked")
  }
  const apiData=props.data && props.data.filter((city)=>{
      console.log(city.cod);
        return city.cod===200;
  });

  return (
    <div onClick={handleClick}>
      {props.apiData && props.apiData.map((city,index)=>{
          return console.log(city);
      })}
    </div>
  )
}
